import React from 'react';
import Link from "next/link";
import Header from "../components/shared/Header";
class Blogs extends React.Component {
    render() {
        return (<div>
            <h1>This page Blogs! </h1>
        <Header title={'This page is blogs!'}>
            <h1> My Blog! </h1>
        </Header>
        </div>
    )
    }
}
export default Blogs;
